      monster1:{
        name:'Virendra'
      },
      monster2:{
        name:'Vishal'
      },
      monster3:{
        name:'Aniketh'
      },
    };
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.monster1.name}</h1>
      </div>
    );
  }
}

export default App;
